  resourceLimits,
  threadId,
  SHARE_ENV,
  Worker,
  parentPort: null,
  workerData: null,
  BroadcastChannel,
  setEnvironmentData,
  getEnvironmentData,
};

'use strict';

const { exitCodes: { kUnfinishedTopLevelAwait } } = internalBinding('errors');

/**
 * Handle a Promise from running code that potentially does Top-Level Await.
 * In that case, it makes sense to set the exit code to a specific non-zero value
 * if the main code never finishes running.
 */
function handleProcessExit() {
  process.exitCode ??= kUnfinishedTopLevelAwait;
}

module.exports = {
  handleProcessExit,
};

import Fastify from "fastify";
import sum from "./routes/sum.js";
import list from "./routes/list.js";
import print from "./routes/print.js";

export const server = Fastify();

const start = async () => {
  try {
    await server.register(sum);
    await server.register(list);
    await server.register(print);

    await server.listen({ port: 3000 });
  } catch (err) {
    process.exit(1);
  }
};

start();

export default async function (fastify) {
  fastify.get("/sum", async (request) => {
    const { a, b } = request.query;

    const sum = parseInt(a) + parseInt(b);
    return { sum };
  });
}

import { addToList } from "../utils.js";

export default async function (fastify) {
  fastify.get("/list", async (request) => {
    const { size } = request.query;
    const arraySize = parseInt(size) || 1;
    const result = addToList(arraySize);

    return { result };
  });
}

export default async function (fastify) {
  fastify.get("/print", async (request) => {
    const { val } = request.query;
    return { value: `${val}!` };
  });
}

const list = [];

export function addToList(size) {
  for (let i = 0; i < size; i++) {
    list.push("Value " + i);
  }
  return list.length;
}

'use strict'

function reusify (Constructor) {
  var head = new Constructor()
  var tail = head

  function get () {
    var current = head

    if (current.next) {
      head = current.next
    } else {
      head = new Constructor()
      tail = head
    }

    current.next = null

    return current
  }

  function release (obj) {
    tail.next = obj
    tail = obj
  }

  return {
    get: get,
    release: release
  }
}

module.exports = reusify

